import React from 'react'

const colorHandle=(cat)=>{
    if(cat==="men"){
        return "blue";
    }
    if(cat==="women"){
        return "pink";
    }if(cat==="men"){
        return "yellow";
    }
}

export default function SecItem(props) {

    return (
        <div className="secItem" style={{backgroundColor:colorHandle(props.category)}}>
            {props.category}
        </div>
    )
}
